INSERT INTO `produtos` VALUES (5,'Truck Independent Stage 11 Polished Standard Silver High 139mm',4,'139mm','Se você busca qualidade e durabilidade para um melhor desempenho em suas seções, o Truck Independent Stage 11 Polished Standard Silver High 139mm  é a escolha perfeita!\n\nO Truck Independent Stage 11 Polished Standard Silver High 139mm  possuí acabamento impecável e a maior durabilidade em truck para skate já vista. É extremamente leve e estiloso, conta com o super projeto Stage 11, que foi desenvolvido para a reformulação da base do truck em estágios, onde garante um giro superior e um maior ganho em estabilidade. \n\nTodos seus componentes utilizados na fabricação, são cuidadosamente projetado e testado para garantir maior agilidade, alem de ser encorpado e durável. O Truck Independent Stage 11 Polished Standard Silver High 139mm é o melhor truck do mercado de skate, seus amortecedores são de extrema qualidade, garantindo um rolê suave e resistente a impactos durante as seções. ',1,X'','329,90');

